g2:c.PROCEDURE.g2:a.TEXT:
_integrity-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules:
   class symbol-list, Client: class object)
  IntPackageListName: symbol = the symbol int-internals-workspaces;
  devstuffName: symbol = the symbol gdev-internals-workspaces;
  Err: class error;
  TopModule: symbol;
  ThisModule: symbol;
  User: class grtl-user-preferences;
  cfg-user: class grtl-default-user-preferences;
  grtl-settings: class grtl-module-settings;

 begin
  TopModule = gfr-get-top-level-module ();
  ThisModule = the containing-module of this procedure;
  if TopModule = ThisModule then begin
    conclude that the user-mode of integrity-default-user-preferences = the symbol modeler;
    conclude that the home-location of integrity-default-user-preferences = "Unspecified";
    cfg-user = call gfr-get-active-setting(the symbol grtl-default-user-preferences, Client);
    conclude that the user-mode of cfg-user = the symbol modeler;

    grtl-settings = call gfr-get-active-setting (the symbol grtl-module-settings, Client);
    conclude that the kb-initial-g2-user-mode-for-this-kb of grtl-settings = the symbol developer;

    conclude that grtl-load-completed = true;
  end;

  {--- For devstuff development environment }
  if the item named by devstuffName exists and _integrity-internals is not a member of the item-list named by devstuffName then
    insert _integrity-internals at the end of the item-list named by devstuffName;

  {--- For collecting the modules that are Integrity specific. }
  if the item named by IntPackageListName exists and _integrity-internals is not a member of the item-list named by IntPackageListName then
    insert _integrity-internals at the end of the item-list named by IntPackageListName;


end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
